                title: '用户id',
                dataIndex: 'eId',
                key: 'eId',
            },
            {
                title:'用户昵称',
                dataIndex:'nickName',
                key:'nickName'
            },
            {
                title:'用户姓名',
                dataIndex:'realName',
                key:'realName'
            },
            {
                title: '用户手机号',
                dataIndex: 'mobile',
                key: 'mobile',
            },
            {
                title: '用户身份',
                dataIndex: 'userType',
